INSERT INTO `news` VALUES (1,2,'<img src=\'http://pronostics4fun.netii.net/Ligue12010/images/sifflet.png\' width=\'20px\' height=\'20px\'/>Ca y est nous y sommes c\'est le coup d\'envoi de la saison 2010/2011, <br/>Que le meilleur gagne et bonne saison à tous !','2010-08-07 21:55:32',4),(2,2,'La première partie de la 1ère journée vient de s\'achever, 9 matcs ce sont joués et <strong>BigBear</strong> et <strong>boubouch</strong> prennent la tête mais juste derrière, avec 1 point de retard, <strong>chatelin</strong> et <strong>war22</strong> sont en embuscade.','2010-08-08 00:21:55',1),(3,2,'Nous voici au terme de cette première journée, et c\'est une victoire de <strong>BigBear</strong> d\'une courte tête sur <strong>chatelin</strong> et <strong>war22</strong> qui ont terminé juste derrière avec 1 point de moins.','2010-08-09 00:27:25',1),(4,2,'<u>La 1ère journée en statistiques:</u>  <br/>- <strong>23</strong> participants -> <strong>221</strong> matchs pronostiqués <br/>- <strong>22</strong>(<i>10%</i>) \"perfects\" sur <strong>85</strong>(<i>38%</i>) matchs \"correct\" <br/>- <strong>885</strong> points marqués','2010-08-09 11:29:30',2),(5,2,'Les matchs bonus <img src=\'http://pronostics4fun.netii.net/Ligue12010/images/star_48.png\'/> des journées 2,3 et 4 ont été déterminé: <br/><strong>J2:</strong> Lille - Paris SG | <strong>J3:</strong> Paris SG - Bordeaux | <strong>J4:</strong> Bordeaux - Marseille','2010-08-11 23:06:34',4),(6,2,'<img src=\'http://pronostics4fun.netii.net/Ligue12010/images/sifflet.png\' width=\'20px\' height=\'20px\'/>Le coup d\'envoi de la 2ème journée vient d\'être donné! Rendez-vous sur le direct pour suivre l\'évolution des scores ainsi que vos résultats.','2010-08-14 11:01:18',4),(7,2,'<img src=\'http://pronostics4fun.netii.net/Ligue12010/images/rain.png\' width=\'20px\' height=\'20px\'/>Le match <strong>Monaco-Montpellier</strong> est reporté pour cause d\'intempéries.','2010-08-14 11:02:50',4),(8,2,'C\'est la fin de la première partie de la 2ème journée, <strong>tofred</strong>, <strong>alix1005</strong> et <strong>gigot</strong> sont au coude à coude pour gagner cette journée. <strong>Blackpoolfc</strong> prend la tête du classement général.','2010-08-14 15:06:12',1),(9,2,'Comme vous le savez la 2ème journée n\'est pas encore terminée (Monaco-Montpellier a été reporté, date non précisée), pour autant nous pouvons dire que la victoire ce jouera entre <strong>tofred</strong> et <strong>alix1005</strong>.','2010-08-15 23:08:33',1),(10,2,'<strong>Tofred</strong> prend la tête du classement général, devant <strong>blackpoolfc</strong>, puis <strong>sdoub</strong> complète le podium.','2010-08-15 23:08:53',1),(11,2,'Stats avant le match de clôture de cette 2ème journée: - <strong>18</strong> participants -> <strong>173</strong> matchs pronostiqués  <br/>- <strong>6</strong>(<i>3%</i>) \"perfects\" sur <strong>43</strong>(<i>24%</i>) matchs \"correct\"  <br/>- <strong>453</strong> points marqués','2010-08-16 12:03:43',2),(12,2,'La date du match <strong>Monaco</strong>-<strong>Montpellier</strong> a été communiqué, il se déroulera le <strong><i>17 Août à 19h00</i></strong>.','2010-08-16 13:11:32',1),(13,2,'Le match en retard de cette 2ème journée vient de se terminer, et c\'est un coup double pour <strong>tofred</strong>, il remporte cette journée et passe en tête du classement général.','2010-08-17 14:09:34',1),(14,2,'<u>Stats de la 2ème journée:</u>  <br/>- <strong>18</strong> participants -> <strong>173</strong> matchs pronostiqués   <br/>- <strong>6</strong>(<i>3%</i>) \"perfects\" sur <strong>52</strong>(<i>30%</i>) matchs \"correct\"   <br/>- <strong>530</strong> points marqués','2010-08-17 14:12:01',2),(15,2,'Pour l\'instant, nous assitons a un sans faute de <strong>marraine ma reine</strong> (7 sur 7, déjà 20 pts de bonus), est-ce que le l\'utime bonus (100 pts) sera accordé aujourd\'hui? réponse ce soir!','2010-08-22 06:09:21',1),(16,2,'Nous voici au terme de cette 3ème journée, et c\'est une 1è